  render() {
    return (
      <div className="page">

          <DataInput />
      <div className="card">
              <img src="https://i.pravatar.cc/100" alt="pic" />
              <div className="content">
                  <h2 id="cardName">Name</h2>
                  <h4 className="title" id="cardTitle">title</h4>
                  <h4 id="cardMobile"></h4>
              </div>
              <button id="contact">CONTACT</button>
      </div>

  </div>
    )
  }
}
